import React from "react";

const Weather = () => {
  fetch(
    "https://community-open-weather-map.p.rapidapi.com/forecast?q=des%20moines%252C%20us&units=imperial",
    {
      method: "GET",
      headers: {
        "x-rapidapi-host": "community-open-weather-map.p.rapidapi.com",
        "x-rapidapi-key": "bceb01c09emsh7333c7d8acd9bbfp114330jsn9662e80626cf",
      },
    }
  )
    .then((response) => {
      console.log(response);
    })
    .catch((err) => {
      console.log(err);
    });

  return <div></div>;
};

export default Weather;
